import React, { useEffect, useState } from 'react';

useEffect(() => {
  const storedUser = localStorage.getItem('user');
  const canadaStatus = localStorage.getItem('isNewToCanada');

  console.log('✅ storedUser:', storedUser);
  console.log('✅ canadaStatus:', canadaStatus);

  if (storedUser && storedUser !== 'undefined') {
    try {
      const parsedUser = JSON.parse(storedUser);
      console.log('✅ parsedUser:', parsedUser);
      setUser(parsedUser);

      if (!canadaStatus || canadaStatus === 'undefined') {
        console.log('✅ Triggering modal...');
        setShowModal(true);
      } else {
        console.log('✅ User has answered already.');
        setIsNewToCanada(canadaStatus);
      }
    } catch (err) {
      console.error('❌ Failed to parse user:', err);
    }
  } else {
    console.log('❌ No user in localStorage');
  }
}, []);
